%[text] # Working with uDALES field data in MATLAB
%[text] This tutorial describes how to read and process field data output of the LES code uDALES using MATLAB. In addition, it describes some important concepts, such as the [grid layout](internal:H_7AB386AF), [variable locations](internal:M_DF9979E4) and [averaging procedures](internal:H_08B0188C).
%[text] The **`udbase`** post-processing class reads in most important input parameters, and contains a number of methods to load field data:
%[text] - [**load\_stat\_xyt**](internal:H_8c2b). This method load the 1D slab- and time-averaged statistics from the file `xytdump.expnr.nc`. Several time-intervals may be present in the data.
%[text] - [**load\_stat\_t**](internal:H_90b8). This method loads the 3D time-averaged statistics from the file `tdump.expnr.nc`. Several time-intervals may be present in the data.
%[text] - [**load\_stat\_tree**](internal:M_8076). This method loads the 3D time-averaged statistics of the tree source terms from the file `treedump.expnr.nc`. This method works exactly the same way as `load_stat_t`.
%[text] - [**load\_field**](internal:H_8324). This method loads instantaneous 3D data from the file `fielddump.expnr.nc`. Several output times may be present in the data.
%[text] - [**load\_slice**](internal:H_825b). This method loads instantaneous 2D slices of instantaneous 3D data from the file `Xslicedump.expnr.nc`. Several output times may be present in the data.
%[text] - [**plot\_trees**](internal:M_8076). This method plots tree patches. \
%[text] **The live matlab file of this tutorial can be found in the repository in the folder /docs/tutorial\_mlx.**
%[text] ## Initialising udbase
%[text] The starting point of this tutorial is that you have run a simulation and have merged the output files. If the simulations were performed on a HPC system, **we assume that you have copied the output directory to your own workstation**. Some of the netCDF (\*.nc) files may be very large and you may only want to copy these if you plan to analyse the data.
%[text] **Note that the uDALES/tools/matlab path must be added via the Set Path button in order to use the udbase class. Alternatively, it can be added using the addpath function inside the script (done here).**
% preamble
clear variables
close all

% add the uDALES matlab path
addpath('C:\Users\mvr\OneDrive - Imperial College London\codes\uDALES\u-dales\tools\matlab')

% create an instance of the udbase class
expnr = 110;
expdir = 'C:\Users\mvr\OneDrive - Imperial College London\projects\2024_uDALES_sprint\udales-pp\experiments\110';
sim = udbase(expnr, expdir); %[output:2c0aebc9]
%%
%[text] %[text:anchor:H_7AB386AF] ## uDALES grid layout
%[text] uDALES uses a grid that is staggered, which means that not all variables are defined at the same location on the grid. Staggering is computationally advantageous \[1\], but requires care with plotting, as it is imporant to plot variables in their correct location. uDALES' grid layout is as follows.
% 2D view of staggered grid arrangement
% (x-z direction; grid layout in other directions is identical)
%
%                           w(i,j,k+1)
%                               ^
% zm(k+1) --            --------|--------
%                       |               |
%                       |   c(i,j,k)    |
%   zt(k) --  u(i,j,k) --->     o      ---> u(i+1,j,k)
%                       |               |
%                       |       ^       |
%   zm(k) --            --------|--------
%                           w(i,j,k)
%
%                       |       |       |
%                     xm(i)   xt(i)   xm(i+1)
%
%   Coordinate positions (assuming z-grid is equidistant)
%   xm(i) = (i-1) * dx;     xt(i) = (i-1/2) * dx
%   ym(j) = (j-1) * dy;     yt(j) = (j-1/2) * dy
%   zm(k) = (k-1) * dz;     zt(k) = (k-1/2) * dz 
%
%   Grid increments:
%   dzt(k) = zm(k+1) - zm(k)
%   dzm(k) = zt(k) - zt(k-1)
%
%   Note that z does not have to be equidistant.
%[text] There are six arrays for the coordinates:
%[text] - `xm.` x-coordinate of cell edges
%[text] - `xt.` x-coordinate of cell centres
%[text] - `ym.` y-coordinate of cell edges
%[text] - `yt.` y-coordinate of cell centres
%[text] - `zm.` z-coordinate of cell edges
%[text] - `zt.` z-coordinate of cell centres \
%[text] The field variables are defined as follows
%[text] - `u(i,j,k)` is the u-velocity at location `(xm(i),yt(j),zt(k))`
%[text] - `v(i,j,k)` is the v-velocity at location `(xt(i),ym(j),zt(k))`
%[text] - `w(i,j,k)` is the w-velocity at location `(xt(i),yt(j),zm(k))`
%[text] - `c(i,j,k)` is a scalar quantity at location `(xt(i),yt(j),zt(k))`  \
%[text] %[text:anchor:M_DF9979E4] Scalars (potential temperature, specific humidity, pollutants) are always defined in the cell-centre. Fluxes are typically defined on the cell edges. 
%[text] **You can always look up where the variables are defined from the output variable information using the load.. methods.**
%%
%[text] %[text:anchor:H_08B0188C] ## Averages used in uDALES output
%[text] Many of the outputs of uDALES have been averaged in some manner. This is advantageous as these are often the quantities we are interested in, and also require much less diskspace and memory to process.
%[text] The Reynolds decomposition is used to decompose variables into mean quantities and their fluctuations \[2\]:
%[text] $\\varphi \\left(x,y,z,t\\right)=\\bar{\\varphi \\;} \\left(x,y,z\\right)+\\varphi {\\;}^{\\prime } \\left(x,y,z,t\\right)${"editStyle":"visual"},
%[text] where the overbar denotes time-averaging. The time-averaged data is contained in the `tdump.expnr.nc` file.
%[text] Often, we are interested in the quantities that are additionally averaged in the horizontal plane. This is often referred to as a **slab average**.  In this case it is common to further decompose the time-averaged quantity $\\bar{\\varphi}${"editStyle":"visual"} into a spatial average $\\langle \\bar{\\varphi} \\rangle \\left(z\\right)${"editStyle":"visual"} (i.e., average over the horizontal surface)  and its spatial variation $\\bar{\\varphi} \\textrm{"}\\left(x,y,z\\right)=\\bar{\\varphi} \\left(x,y,z\\right)-\\langle \\bar{\\varphi} \\rangle \\left(z\\right)${"editStyle":"visual"}. Upon substituting this expression into the equation above, we obtain the triple decomposition \[3\]: 
%[text] $\\varphi \\left(x,y,z,t\\right)=\\langle \\bar{\\varphi} \\rangle \\left(z\\right)+\\bar{\\varphi} \\textrm{"}\\left(x,y,z\\right)\\;+\\varphi^{\\prime } \\left(x,y,z,t\\right)${"editStyle":"visual"}.
%[text] Here, $\\langle \\bar{\\varphi \\;} \\rangle${"editStyle":"visual"} is an *intrinsic* average, defined as \[3\]
%[text] $\\langle \\bar{\\varphi} \\rangle \\;\\left(z\\right)=\\frac{1}{A\_f }\\int\_{\\Omega\_{f\\;} } \\varphi \\;\\mathrm{dA}${"editStyle":"visual"}
%[text] where $A\_f \\left(z\\right)${"editStyle":"visual"} is the area occupied by fluid and $\\Omega\_f${"editStyle":"visual"} is the horizontal surface that is occupied by the fluid. The quantity $\\langle \\bar{\\varphi} \\rangle${"editStyle":"visual"} represents the average value of $\\bar{\\varphi}${"editStyle":"visual"} inside the fluid between the buildings. Another commonly used quantity is the *comprehensive* average $\\langle \\bar{\\varphi} \\rangle\_C${"editStyle":"visual"}, which is defined as 
%[text] $\\langle \\bar{\\varphi} \\rangle\_C \\left(z\\right)=\\frac{1}{A}\\int\_{\\Omega\_{f\\;} } \\varphi \\;\\mathrm{dA}=\\frac{A\_f }{A}\\langle \\bar{\\varphi} \\rangle \\left(z\\right)${"editStyle":"visual"}
%[text] where $A${"editStyle":"visual"} is the total surface area. In many cases, it is more convenient to work with comprehensive averages than intrinsic averages, particularly when considering averaged budgets of momentum, temperature etc \[3\]. To convert the intrinsic-average output from uDALES into a comprehensive average, simply multiply the intrinsic average by $A\_f /A${"editStyle":"visual"} as shown above. Time and intrinsically-averaged data is contained in the `xytdump.expnr.nc` file.
%%
%[text] %[text:anchor:H_8c2b] ## load\_stat\_xyt: loading time- and slab-averaged data
help sim.load_stat_xyt %[output:858992ee]
%[text] This method loads a single output variable `var` at a time. In order to understand which variables are present in the output file, call the method without input arguments.
sim.load_stat_xyt(); %[output:79b04c17]
%[text] Before showing how to display the data, we note that the variable `'time'` has a size `1` $\\times$ `3`. Let's load the data to see what is inside.
txyt = sim.load_stat_xyt('time') %[output:1291ab65]
%[text] There are three times at which output has been generated. This can be understood by considering the input parameter values
sim.tstatsdump %[output:7e01db53]
sim.runtime %[output:3af5053e]
%[text] Therefore, the entire runtime is divided into 3 time intervals, in each of which the time average is taken.
%[text] The vertical coordinate $z${"editStyle":"visual"} and mean streamwise velocity $\\langle \\bar{u} \\rangle${"editStyle":"visual"} can be loaded as:
zm   = sim.load_stat_xyt('zm');
uxyt = sim.load_stat_xyt('uxyt');
%[text] Since $\\langle \\bar{u} \\rangle${"editStyle":"visual"} is the streamwise velocity, it is defined in the vertical cell-center and should thus be plotted against `zm`. We plot $\\langle \\bar{u} \\rangle${"editStyle":"visual"} for each averaging time interval below.
tstart = 0;
leg = cell(size(txyt)); % create a cell array to store each of the legend entries
figure %[output:76e753e5]
hold on %[output:76e753e5]
for n = 1:length(txyt)
    plot(uxyt(:, n), zm, 'Linewidth', 1); %[output:76e753e5]
    leg{n} = ['$t=', num2str(tstart, '%8.0f'), '-', num2str(txyt(n), '%8.0f'), '$s'];
    tstart = txyt(n);
end
hold off %[output:76e753e5]
box on %[output:76e753e5]
ylabel ('$z$ [m]', 'Interpreter', 'latex') %[output:76e753e5]
xlabel ('$\langle \overline{u} \rangle$ [m/s]', 'Interpreter', 'latex') %[output:76e753e5]
legend(leg, 'Location','northwest', 'Interpreter', 'latex') %[output:76e753e5]
%[text] As can be seen, during the first time-interval, the flow is substantially slower than in the other two intervals, suggesting an initial transient. Although the profiles for last two time-intervals are close, they are not identical showing that either the flow has not equilibriated entirely, or the chosen averaging time-interval was too small, or both.
%%
%[text] Using the continuity equation it can be shown that for period domains $\\langle \\bar{w} \\rangle =0${"editStyle":"visual"}, which also implies that $\\langle \\bar{w} \\textrm{"}\\rangle =0${"editStyle":"visual"}. This means that the dispersive momentum flux $\\langle \\bar{u\\;} \\textrm{"}\\bar{w\\;} \\textrm{"}\\rangle${"editStyle":"visual"} is equal to $\\langle \\bar{\\;u} \\;\\bar{\\;w} \\rangle${"editStyle":"visual"}. Thus, we can load the mean turbulent horizontal momentum flux $\\langle \\bar{u^{\\prime } w^{\\prime } } \\rangle${"editStyle":"visual"} and dispersive flux $\\langle \\bar{u\\;} \\textrm{"}\\bar{w\\;} \\textrm{"}\\rangle${"editStyle":"visual"} can be loaded as:
zt      = sim.load_stat_xyt('zt');      % location of vertical fluxes of horizontal momentum
upwpxyt = sim.load_stat_xyt('upwpxyt'); % turbulence fluxes (p indicates prime)
uwxyt   = sim.load_stat_xyt('uwxyt');   % dispersive fluxes
%[text] Note that these terms should be plotted against against `zt` (cell center) since they represent the vertical exchange of horizontal momentum. Again, we plot the averages for each time interval (now we can do this more compactly as we do not need to create the legend entries):
figure %[output:7e944efd]
subplot(1,3,1); %[output:7e944efd]
plot(upwpxyt, zt, 'LineWidth',1); %[output:7e944efd]
xlabel ('$\langle \overline{u^\prime w^\prime} \rangle$ [m$^2$/s$^2$]', ... %[output:7e944efd]
    'Interpreter', 'latex') %[output:7e944efd]
ylabel ('$z$ [m]', 'Interpreter', 'latex') %[output:7e944efd]
xlim([-0.5 0]) %[output:7e944efd]

subplot(1,3,2); %[output:7e944efd]
plot(uwxyt, zt, 'LineWidth',1); %[output:7e944efd]
xlabel (['$\langle \overline{u}^{\prime\prime} \overline{w}^{\prime\prime} \rangle$' ... %[output:7e944efd]
    ' [m$^2$/s$^2$]'], 'Interpreter', 'latex') %[output:7e944efd]
xlim([-0.5 0]) %[output:7e944efd]

subplot(1,3,3); %[output:7e944efd]
plot(uwxyt+upwpxyt, zt, 'LineWidth',1); %[output:7e944efd]
xlabel (['$\langle \overline{u^\prime w^\prime} \rangle+\langle \overline{u}^{\prime\prime} \overline{w}^{\prime\prime} \rangle$' ... %[output:7e944efd]
    ' [m$^2$/s$^2$]'], 'Interpreter', 'latex') %[output:7e944efd]
xlim([-0.5 0]) %[output:7e944efd]
legend(leg, 'Location','northwest', 'Interpreter', 'latex') %[output:7e944efd]
%[text] To interpret this data, it is easiest to start with the right-most figure which plots the sum of the dispersive and turbulent fluxes. In a steady state (and for a simulation with a constant pressure gradient of average velocity), we expect this quantity to form a straight line, which is the case for the last two time-intervals. The data are also nearly collapsing for the last two time-intervals, once more suggesting that these flows are close to a statistical steady state. 
%[text] The turbulent and dispersive fluxes show substantial variation for all three curves, showing that much longer averaging is needed to obtain reliable statistics for these quantities \[4\].
%%
%[text] %[text:anchor:H_90b8] ## load\_stat\_t: loading time-averaged data
help sim.load_stat_t %[output:2959cd41]
%[text] The time-averaged field data is stored in the `tdump.expnr.nc` file. The variables it contains can be listed as:
sim.load_stat_t(); %[output:4e438ab3]
%[text] We load the time-averaged streamwise velocity field u, and the coordinates it relates to. **Note that the appropriate coordinate arrays are listed in the 'Dimensions' column above.**
ut = sim.load_stat_t('ut');
tt = sim.load_stat_t('time');
xm = sim.load_stat_t('xm'); % we are interested in plotting u  
yt = sim.load_stat_t('yt');
zt = sim.load_stat_t('zt');
%%
%[text] We plot a horizontal slice at the mean building height `z=10m`, choosing to use the statistics of the last time-interval
% find the k-index closest to z=10 m
zloc = 10;
k = find(abs(zt - zloc) == min(abs(zt - zloc)), 1);

% choose last time interval
n = length(tt); 

figure %[output:2361177b]
pcolor(xm, yt, squeeze(ut(:,:,k,n))');  %[output:2361177b]
shading flat; axis equal tight; colorbar %[output:2361177b]
xlabel('$x$ [m]', 'Interpreter','latex')                     %[output:2361177b]
ylabel('$y$ [m]', 'Interpreter','latex') %[output:2361177b]
title(['$\overline u(x, y, z=', num2str(zt(k), '%8.1f'), 'm)$; no NaNs'], 'Interpreter','latex') %[output:2361177b]
%[text] You can see that where the buildings are, the velocity is zero. However, since this is a solid domain, you will want to remove these from the plot. You can use the arrays  `Su, Sv, Sw` and `Sc` in the sim object for this, which are 3D boolean matrices that indicate the cells contain buildings as true. There are four different arrays since the grid is staggered. We are dealing with the u-velocity, so will use the array `Su`. In order to do so, we can simply set the cells that contain solid elements to `NaN`.
curut = ut(:,:,:,n);
curut(sim.Su) = NaN;

figure %[output:6597416d]
pcolor(xm, yt, squeeze(curut(:,:,k))');  %[output:6597416d]
shading flat; axis equal tight; colorbar %[output:6597416d]
xlabel('$x$ [m]', 'Interpreter','latex') %[output:6597416d]
ylabel('$y$ [m]', 'Interpreter','latex') %[output:6597416d]
title(['$\overline u(x, y, z=', num2str(zt(k), '%8.1f'), 'm)$'], 'Interpreter','latex') %[output:6597416d]
%[text] Similarly, we can plot a vertical slice in the middle of the y-domain as follows.
j = sim.jtot/2+1; % select the index in the middle of the domain span

figure %[output:58aa97ad]
pcolor(xm, zt, squeeze(curut(:,j,:))');    %[output:58aa97ad]
shading flat; axis equal tight; colorbar %[output:58aa97ad]
xlabel('$x$ [m]', 'Interpreter','latex')                     %[output:58aa97ad]
ylabel('$z$ [m]', 'Interpreter','latex') %[output:58aa97ad]
title(['$\overline u(x, y=', num2str(yt(j), '%8.1f'), 'm, z)$'], 'Interpreter','latex') %[output:58aa97ad]
%[text] ## 
%%
%[text] %[text:anchor:H_8324] ## load\_field: loading instantaneous 3D data
help sim.load_field %[output:60477d9a]
%[text] The instantaneous field data is stored in the field`dump.expnr.nc` file, again, the variables it contains can be listed as:
sim.load_field(); %[output:6f9ff608]
%[text] The variable `time` contains the times at which output is written. Let's load the data to see which times these are
t = sim.load_field('time') %[output:4c4af437]
%[text] These times can be understood by noticing that the output interval requested in the input file is
sim.tfielddump %[output:7e262737]
%[text] We load the data, once more using the horizontal velocity 
u  = sim.load_field('u');
xm = sim.load_field('xm');
yt = sim.load_field('yt');
zt = sim.load_field('zt');
%[text] We plot the instantaneous horizontal velocity at the same locations as in the previous section using the last output time
n = length(t); % choose last output time 

% set the u-value inside buildings to NaN
curu = u(:,:,:,n);
curu(sim.Su) = NaN;

figure %[output:6c4a8436]
pcolor(xm, yt, squeeze(curu(:,:,k))');    %[output:6c4a8436]
shading flat; axis equal tight; colorbar %[output:6c4a8436]
xlabel('$x$ [m]', 'Interpreter','latex')                     %[output:6c4a8436]
ylabel('$y$ [m]', 'Interpreter','latex') %[output:6c4a8436]
title(['$u(x, y, z=', num2str(zt(k), '%8.1f'), 'm, t=', num2str(t(n), '%8.0f'),'s)$'], 'Interpreter','latex') %[output:6c4a8436]
figure %[output:2381ac1b]
pcolor(xm, zt, squeeze(curu(:,j,:))');    %[output:2381ac1b]
shading flat; axis equal tight; colorbar %[output:2381ac1b]
xlabel('$x$ [m]', 'Interpreter','latex')                     %[output:2381ac1b]
ylabel('$y$ [m]', 'Interpreter','latex') %[output:2381ac1b]
title(['$u(x, y, z=', num2str(zt(k), '%8.1f'), 'm, t=', num2str(t(n), '%8.0f'),'s)$'], 'Interpreter','latex') %[output:2381ac1b]
%%
%[text] %[text:anchor:H_825b] ## load\_slice: loading instantaneous 2D slice data
help sim.load_slice %[output:638df8b9]
%[text] The instantaneous slice data is stored in the `Xslicedump.expnr.nc` file. This file contains particular slices of the 3D instantaneous data, which makes this data particularly suitable for creating animations since the output frequency can be much higher than for 3D fields as the filesize will remain much more manageable. 
%[text] uDALES is capable of outputting slices along the `x`, `y` or `z`-direction. In this particular simulation, we requested to output horizontal slices (fixed height in vertical direction using an index `kslice`, e.g., `zm(kslice)`) using the input parameter:
sim.lkslicedump %[output:3981791a]
%[text] at index
sim.kslice %[output:61b591ae]
%[text] and output instantaneous slices at time-intervals
sim.tsample %[output:428567b4]
%[text] The first argument to the load\_slice method is the slice direction:
%[text] - '`i`': vertical slices taken at fixed `x`. Outputs data that is a function of `y,z` and `t`.
%[text] - '`j`': vertical slices taken at fixed `y`. Outputs data that is a function of `x,z` and `t`.
%[text] - '`k`': horizontal slices taken at fixed `z`. Outputs data that is a function of `x,y` and `t`.   \
%[text] To list all the variables stored in `kslicedump.expnr.nc`, we use
sim.load_slice('k'); %[output:7561360d]
%[text] This horizontal slice is at `z = zm(sim.kslice)` or `z = zt(sim.kslice)`, depending on the variable.
%[text] To load the data, we specify the variables we wish to load:
xm = sim.load_slice('k', 'xm');
yt = sim.load_slice('k', 'yt');
uk = sim.load_slice('k', 'u_kslice');
t  = sim.load_slice('k', 'time');
%[text] We plot this horizontal slice of the instantaneous velocity at the last output time:
n = length(t); % choose the last time-step

% Replace the data at building locations with NaNs
curu = squeeze(uk(:,:,n));
curu(squeeze(sim.Su(:,:,sim.kslice))) = NaN;

% note that the squeeze command is not formally needed here, but they will
% be needed when considering i and j slices.

% plot the data
figure %[output:2c63f6f8]
pcolor(xm, yt, curu'); %[output:2c63f6f8]
shading flat; axis equal tight; %[output:2c63f6f8]
xlabel('$x$ [m]', 'Interpreter','latex')                   %[output:2c63f6f8]
ylabel('$y$ [m]', 'Interpreter','latex') %[output:2c63f6f8]
colorbar %[output:2c63f6f8]
title(['$u(x,y,z=', num2str(zm(sim.kslice), '%8.1f'), 'm, t=', num2str(t(n), '%8.0f'), 's)$'], 'Interpreter','latex') %[output:2c63f6f8]
%%
%[text] %[text:anchor:M_8076] ## load\_stat\_tree and plot\_tree: loading and plotting tree data
%[text] We next switch to a tree simulation to show the tree functions example
clear variables;
expnr = 525;
expdir = 'C:\Users\mvr\OneDrive - Imperial College London\projects\2024_uDALES_sprint\udales-pp\experiments\525';

sim = udbase(expnr, expdir); %[output:256bbcf0] %[output:157d3deb]
%[text] The trees patches can be plotted using
sim.plot_trees; %[output:55135b7b]
%[text] The time-averaged tree source data is stored in the `treedump.expnr.nc` file. The variables it contains can be listed as:
help sim.load_stat_tree %[output:20e20810]
sim.load_stat_tree(); %[output:8048142c]
%%
